import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import { authAPI } from '../utils/auth';
import '../styles/Signup.css';

const SignUp = () => {
    const [username, setUsername] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');
    const [isLoading, setIsLoading] = useState(false);
    const history = useHistory();

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');
        setIsLoading(true);

        try {
            const response = await authAPI.register({
                username,
                email,
                password,
            });
            
            if (response.success) {
                // Registration successful, redirect to sign in
                history.push('/signin');
            } else {
                setError(response.message || 'Registration failed');
            }
        } catch (err) {
            console.error('Registration error:', err);
            let errorMessage = 'Registration failed. Please try again.';
            
            if (err.response) {
                // Server responded with error status
                errorMessage = err.response.data?.message || 'Registration failed';
            } else if (err.request) {
                // Network error
                errorMessage = 'Network error. Please check your connection.';
            }
            
            setError(errorMessage);
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <div className="signup-container">
            <div className="signup-background">
                <div className="gradient-circle blue"></div>
                <div className="gradient-circle teal"></div>
                <div className="gradient-circle purple"></div>
            </div>
            <div className="signup-card">
                <div className="signup-header">
                    <h1>Create Account</h1>
                    <p>Start your data science journey with us</p>
                </div>
                {error && (
                    <div 
                        className="error-message"
                        style={{
                            backgroundColor: '#fee2e2',
                            color: '#dc2626',
                            padding: '12px 16px',
                            borderRadius: '8px',
                            marginBottom: '20px',
                            border: '1px solid #fecaca',
                            fontSize: '14px',
                            textAlign: 'center'
                        }}
                    >
                        {error}
                    </div>
                )}
                <form className="signup-form" onSubmit={handleSubmit}>
                    <div className="input-group">
                        <label htmlFor="username">Username</label>
                        <input
                            id="username"
                            type="text"
                            placeholder="Enter your username"
                            value={username}
                            onChange={(e) => setUsername(e.target.value)}
                            required
                        />
                    </div>
                    <div className="input-group">
                        <label htmlFor="email">Email</label>
                        <input
                            id="email"
                            type="email"
                            placeholder="Enter your email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            required
                        />
                    </div>
                    <div className="input-group">
                        <label htmlFor="password">Password</label>
                        <input
                            id="password"
                            type="password"
                            placeholder="Create a password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            required
                        />
                    </div>
                    <button className="signup-button" type="submit" disabled={isLoading}>
                        {isLoading ? <span className="loading-spinner"></span> : 'Register'}
                    </button>
                </form>
                <div className="signup-footer">
                    <p>Already have an account? <a href="/signin">Sign in</a></p>
                    <div className="divider">or</div>
                    <button className="social-button google">
                        <svg width="18" height="18" viewBox="0 0 24 24" fill="none">
                            <path d="M22.56 12.25c0-.78-.07-1.53-.2-2.25H12v4.26h5.92c-.26 1.37-1.04 2.53-2.21 3.31v2.77h3.57c2.08-1.92 3.28-4.74 3.28-8.09z" fill="#4285F4"/>
                            <path d="M12 23c2.97 0 5.46-.98 7.28-2.66l-3.57-2.77c-.98.66-2.23 1.06-3.71 1.06-2.86 0-5.29-1.93-6.16-4.53H2.18v2.84C3.99 20.53 7.7 23 12 23z" fill="#34A853"/>
                            <path d="M5.84 14.09c-.22-.66-.35-1.36-.35-2.09s.13-1.43.35-2.09V7.07H2.18C1.43 8.55 1 10.22 1 12s.43 3.45 1.18 4.93l2.85-2.22.81-.62z" fill="#FBBC05"/>
                            <path d="M12 5.38c1.62 0 3.06.56 4.21 1.64l3.15-3.15C17.45 2.09 14.97 1 12 1 7.7 1 3.99 3.47 2.18 7.07l3.66 2.84c.87-2.6 3.3-4.53 6.16-4.53z" fill="#EA4335"/>
                        </svg>
                        Continue with Google
                    </button>
                </div>
            </div>
        </div>
    );
};

export default SignUp;
